var BrandProfile = React.createClass({
    displayName: "BrandProfile",

    /**
     *
     */
    getInitialState: function () {
        return { item: {}, serverLoading: false, isFollowing: false };
    },
    /**
     *
     */
    loadDataFromServer: function () {
        App.Stores.loadData({
            url: App.Routes.showBrand,
            action: App.Actions.BRAND_INOFO_CHANGED,
            params: { id: this.props.id }
        });
    },
    /**
     */
    componentDidMount: function () {
        App.Dispatcher.attach(App.Actions.BRAND_FOLLOWING, this.onFollowingChanged);
        App.Dispatcher.attach(App.Actions.BRAND_INOFO_CHANGED, this.onBrandInfoChanged);
        this.loadDataFromServer();
    },
    /**
     *
     */
    componentWillUnmount: function () {
        App.Dispatcher.detach(App.Actions.BRAND_FOLLOWING, this.onFollowingChanged);
        App.Dispatcher.attach(App.Actions.BRAND_INOFO_CHANGED, this.onBrandInfoChanged);
    },
    /*
      */
    onBrandInfoChanged: function (brandInfo) {
        if (brandInfo.id == this.props.id) {
            this.setState({
                serverLoading: false,
                item: brandInfo,
                isFollowing: brandInfo.is_following
            });
        }
    },

    /**
     *
     * @param payload
     */
    onFollowingChanged: function (payload) {
        if (payload.action && payload.data && payload.data.brand_id == this.state.item.id) {
            var isFollowing = undefined;
            if (payload.action == App.Actions.BRAND_FOLLOW) {
                isFollowing = true;
            } else if (payload.action == App.Actions.BRAND_UNFOLLOW) {
                isFollowing = false;
            }
            if (isFollowing != this.state.isFollowing) {
                var oldItem = this.state.item;
                oldItem.followers_count = payload.data.followers_count;
                this.setState({ isFollowing: isFollowing, item: oldItem });
            }
        }
    },
    /**
     *
     */
    toggleFollowing: function () {
        var id = this.state.item.id;
        App.Stores.post({
            url: this._getFollowActionUrl(this.state.isFollowing, id),
            action: App.Actions.BRAND_FOLLOWING,
            event: {
                id: id
            }
        });
    },
    /**
     *
     * @param isFollowing
     * @param id
     * @private
     */
    _getFollowActionUrl: function (isFollowing, id) {
        var url = isFollowing ? App.Routes.unFollowBrand : App.Routes.followBrand;
        return App.Helpers.formatApiUrl(url, { id: id });
    },
    /**
     *
     */
    onDataChange: function (result) {
        this.setState({ serverLoading: true });
    },
    /**
     *
     */
    render: function () {
        var items;
        var followingClass = this.state.isFollowing ? "ti-unlink" : "ti-link";
        var activeTab = this.props.activeTab;
        // FIXME , make this dynamic
        var tabClassInstance = null;
        // data is loaded
        if (this.state.item.id) {
            switch (activeTab) {
                case INFO_TAB:
                default:
                    tabClassInstance = React.createElement(BrandProfileInfo, { id: this.props.id, brandInfo: this.props.brandInfo });
                    break;
                case STORES_TAB:
                    tabClassInstance = React.createElement(BrandProfileStoresInfo, { positions: this.props.stores });
                    break;
                case PRODUCTS_TAB:
                    tabClassInstance = React.createElement(ProductsList, { id: this.props.id, brand: this.props.id });
                    break;
                case REVIEWS_TAB:
                    tabClassInstance = React.createElement(BrandProfileReviewsList, {
                        authenticityToken: this.props.authenticityToken,
                        id: this.props.id });
                    break;
                case FOLLOWERS_TAB:
                    tabClassInstance = React.createElement(BrandProfileFollowersList, { id: this.props.id });
                    break;

            }
        }
        var container = tabClassInstance;
        return React.createElement(
            "div",
            null,
            React.createElement(
                "div",
                { className: "BrandDetails" },
                React.createElement(
                    "div",
                    { className: "BrandDetails__Verified" },
                    React.createElement("span", { className: "ti-shield" })
                ),
                React.createElement(
                    "div",
                    { className: "BrandDetails_Header" },
                    React.createElement(
                        "div",
                        { className: "BrandDetails__Title" },
                        React.createElement(
                            "span",
                            null,
                            this.state.item.name
                        )
                    ),
                    React.createElement(
                        "div",
                        { className: "BrandDetails__ImageContainer" },
                        React.createElement("img", { className: "BrandDetails__ImageCover", src: this.props.cover })
                    ),
                    React.createElement(
                        "button",
                        {
                            className: "BrandDetails__Follow BrandCard__FollowButton--" + (this.state.isFollowing ? "on" : "off"),
                            onClick: this.toggleFollowing },
                        React.createElement("i", { className: followingClass })
                    ),
                    React.createElement(
                        "ul",
                        { className: "nav nav-tabs" },
                        React.createElement(
                            "li",
                            { className: activeTab == INFO_TAB || !activeTab ? ACTIVE_CLASS : '' },
                            React.createElement(
                                "a",
                                { href: App.Helpers.getAbsoluteUrl(App.Routes.brandInfo, { id: this.props.id }) },
                                React.createElement("i", { className: "fa fa-circle" }),
                                " Info"
                            )
                        ),
                        React.createElement(
                            "li",
                            { className: activeTab == STORES_TAB ? ACTIVE_CLASS : '' },
                            React.createElement(
                                "a",
                                { href: App.Helpers.getAbsoluteUrl(App.Routes.brandStores, { id: this.props.id }) },
                                React.createElement("i", { className: "fa fa-circle" }),
                                " Stores (",
                                this.state.item.stores_count,
                                ")"
                            )
                        ),
                        React.createElement(
                            "li",
                            { className: activeTab == PRODUCTS_TAB ? ACTIVE_CLASS : '' },
                            React.createElement(
                                "a",
                                { href: App.Helpers.getAbsoluteUrl(App.Routes.brandProducts, { id: this.props.id }) },
                                React.createElement("i", { className: "fa fa-circle" }),
                                " Products (",
                                this.state.item.products_count,
                                ")"
                            )
                        ),
                        React.createElement(
                            "li",
                            { className: activeTab == REVIEWS_TAB ? ACTIVE_CLASS : '' },
                            React.createElement(
                                "a",
                                { href: App.Helpers.getAbsoluteUrl(App.Routes.brandReviews, { id: this.props.id }) },
                                React.createElement("i", { className: "fa fa-circle" }),
                                " Reviews (",
                                this.state.item.reviews_count,
                                ")"
                            )
                        ),
                        React.createElement(
                            "li",
                            { className: activeTab == FOLLOWERS_TAB ? ACTIVE_CLASS : '' },
                            React.createElement(
                                "a",
                                { href: App.Helpers.getAbsoluteUrl(App.Routes.brandFollowers, { id: this.props.id }) },
                                React.createElement("i", { className: "fa fa-circle" }),
                                " Followers (",
                                this.state.item.followers_count,
                                ")"
                            )
                        )
                    )
                ),
                container
            )
        );
    }
});
